import kasaLogo from "./asset/images/D_Footer.png";

function Header () {
    
return (
    <div className="kasa-header-banner">
      <div className="kasa-header-titre">
        <img src={kasaLogo} alt="logo Kasa"></img>         
      </div>
        <div className="kasa-liennav">
          
            <a href="#accueil" className="nav1">Accueil</a>
            <a href="#apropos" className="nav2">A Propos</a> 
             
        </div>
    </div>
  );
}

export default Header
